- input: "TEXT\x1CC00161786\x1CTEXT-00001\x1C\x1CF3XN\x1CPer the agreement between
    DNC Counsel, Neil Reiff, and RAD Supervisor, Debbie Chacona, the Memo Schedule
    A's that itemize the committees share of the gross contributions received through
    the joint fundraising activities from the ASDC Dollars for Democrats and ASDC
    Partnership Program (Association of State Democratic Chairs), the DNC Victory
    Fund (Democratic National Committee) and / or the Committee for Change are provided
    on a quarterly basis.    The transfer of the joint fundraising proceeds received
    during this reporting period from the DNC Victory Fund, ASDC Dollars for Democrats,
    \ ASDC Partnership programs, and the Committee for Change represents the committee's
    share of proceeds for contributions received during this or prior reporting periods.
    The memo entries for these contributions are included in this or a prior report
    of the committee.  -   Determination of usual and normal charges for Enhanced
    Online Voter File Access for payments received on Schedule A, Line 17 of the Committees
    report was calculated by the total cost of developing and hosting our online voter
    file and dividing it by the number of records within the file as well as the presumed
    number of overall users.  The cost to the organization is then determined by the
    number of records requested and the length of time access will be granted.  i.e.
    Statewide or congressional charges are based on the number of records in the district
    or entire state as requested.  -  Please note that the employees that were disclosed
    on Schedule H4 supporting Line 21(a) as payroll spent less than 25% of their time
    during the period working on any Federal Election Activity or activities in connection
    with a Federal Election therefore salary payments were allocable.  This also includes
    fringe benefits for those specific employees.\n"
